import "./TodoHomeLayout.css";
import { Link, Outlet, useLocation, useNavigate } from "react-router-dom";
import { useState } from "react";
import LiveClock from "./LiveClock";
// MUI imports
import { Box, Button, Typography, Paper, TextField, List, ListItem, ListItemButton, ListItemText } from "@mui/material";
import { ThemeProvider, createTheme } from "@mui/material/styles";

const theme = createTheme({
  palette: {
    primary: {
      main: "#cdd181ff",
    },
  },
});

export default function TodoLayout() {
  const [search, setSearch] = useState("");
  const navigate = useNavigate();
  const location = useLocation();
  const username = localStorage.getItem("username");

  return (
    <ThemeProvider theme={theme}>
      <Box sx={{ minHeight: "100vh", bgcolor: "#f5f5f5" }}>
        <Box
          component="header"
          sx={{
            display: "flex",
            alignItems: "center",
            justifyContent: "space-between",
            px: 3,
            py: 2,
            bgcolor: "primary.main",
            color: "#fff",
          }}
        >
          <LiveClock />
          <Typography variant="h5" sx={{ flexGrow: 1, textAlign: "center" }}>
            My Todo App
          </Typography>
          <Box sx={{ display: "flex", flexDirection: "column", alignItems: "flex-end" }}>
            <Typography variant="subtitle1" sx={{ fontWeight: "bold" }}>
              {username}
            </Typography>
            <Button
              component={Link}
              to="/"
              color="inherit"
              size="small"
              sx={{ mt: 0.5, textTransform: "none" }}
              title="Logout"
            >
              ‚èª Logout
            </Button>
          </Box>
        </Box>

        <Box className="container" sx={{ display: "flex", minHeight: "calc(100vh - 64px)" }}>
          {/* Sidebar */}
          <Paper
            elevation={2}
            sx={{
              width: 250,
              minWidth: 200,
              p: 2,
              bgcolor: "#fafafa",
              display: "flex",
              flexDirection: "column",
              gap: 2,
            }}
          >
            <Box
              component="form"
              onSubmit={(e) => {
                e.preventDefault();
                navigate(`/todoshome/search?description=${search}`);
              }}
              sx={{ display: "flex", gap: 1, mb: 2 }}
            >
              <TextField
                size="small"
                placeholder="Search tasks..."
                value={search}
                onChange={(e) => setSearch(e.target.value)}
                variant="outlined"
                fullWidth
              />
              <Button type="submit" variant="contained" color="primary">
                Search
              </Button>
            </Box>

            <List>
              <ListItem disablePadding>
                <ListItemButton component={Link} to="create">
                  <ListItemText primary="‚ûï Create Todo" />
                </ListItemButton>
              </ListItem>
              <ListItem disablePadding>
                <ListItemButton component={Link} to="todos">
                  <ListItemText primary="üìã All Todos" />
                </ListItemButton>
              </ListItem>
            </List>
          </Paper>

          {/* Main View */}
          <Box className="main" sx={{ flexGrow: 1, p: 3 }}>
            {location.pathname === "/todoshome" ? (
              <Paper elevation={1} sx={{ p: 4, textAlign: "center" }}>
                <Typography variant="h6" gutterBottom>
                  Welcome, {username}! üéâ
                </Typography>
                <Typography variant="body1">
                  Select an option from the sidebar to get started.
                </Typography>
                {/* You can also show summary stats here if you want */}
              </Paper>
            ) : (
              <Outlet />
            )}
          </Box>
        </Box>
      </Box>
    </ThemeProvider>
  );
}
